import React from 'react' 

class Formulario extends React.Component {

    handleChange = (e) => console.log({value:e.target.value})


    render() {
        return(
            <div className="container">
           <form>
               <input
                onChange = {this.handleChange}
                tipe= "text"></input>
           </form>
           </div>
        )
    }
}

export default Formulario
